import React from 'react';
import productCard from './productCard.module.css';
import cupcakes1 from '../../Images/cupcakes.png';
import cupcakes2 from '../../Images/cupcakes2.png';
import cupcakes3 from '../../Images/cupcakes3.png';
import cupcakes4 from '../../Images/cupcakes4.png';
import cupcakes5 from '../../Images/cupcakes5.png';

function ProductCard(props) {
  // Создайте массив изображений
  const cupcakesImages = [cupcakes1, cupcakes2, cupcakes3, cupcakes4, cupcakes5];

  return (
    <div>
      {props.data.map((item, index) => (
        <div key={item.id} className={productCard.container}>
          <div className={productCard.image}>
            {/* Картинка товара */}
            <img src={cupcakesImages[index]} alt={item.titleProduct} />
          </div>
          <div className={productCard.overview}>
            {/* Обертка описания товара */}
            <div className={productCard.titleProduct}>{item.titleProduct}</div>
            {/* Название товара */}
            <div className={productCard.description}>{item.overview}</div>
            {/* Описание товара */}
            <div className={productCard.price}>{item.price}</div>
            {/* Цена товара */}
            <div className={productCard.productAvability}>{item.productAvability}</div>
            {/* Наличие заказа */}
          </div>
        </div>
      ))}
    </div>
  );
}

export default ProductCard;



